  false,\n\t\"url\": null,\n\t\"notes\": \"Thermal waters produced from large oil
  fields are currently the most important geothermal resources in Los Angeles County.
  Assuming that various technological and economic considerations are favorable, many
  of these fields are promising sources of heat for diverse applications outside the
  field operations. Otherwise, the County does not appear to have any large, near-surface
  geothermal resources.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
